class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        it = 0
        findS = True
        for cs in s:
            print(it)
            findCs = False
            for i in range(it, len(t)):
                if t[i] == cs:
                    it = i + 1
                    findCs = True
                    break
            if not findCs:
                findS = False
                break
        return findS

if __name__ == "__main__":
    s = "abc"
